import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Switch } from 'react-router-dom';
import CustomerDashBoard from './customers'; // Import your CustomerTable component
import ColorTiles from './ColorTiles'; // Import your ColorTiles component
import UserDashBoard from './users';
import Login from './login';
import ClientViewer from './clientViewer';

function App() {
  return (
    <Router>
      <Switch>
          <Route path="/customers" component={<CustomerDashBoard/>} />
          <Route path="/users" component={<UserDashBoard/>} />
          <Route path="/ColorTiles" elemencomponent={<ColorTiles/>} />
          <Route path="/" component={<Navigate to="/login" />} />
          <Route path="/login" component={<Login />} />
          <Route path="/clientViewer" component={<ClientViewer />} />
      </Switch>
    </Router>
  );
}

export default App;

